['God bless this man ', '5:20 just a small nitpick, but "dz" should be called "mdz", because dz by itself should be divided by m. That division is deferred for better precision I presume, so it's really m*dz = mdz.
I appreciate a lot your teaching, thanks!

Those are the notes I put on my code to help in understanding what's going on:

                // cost function m*J(L) = sum (L)
                // loss function L(a2,y) = - (y*log(a2) + (1-y)log(1-a2)) <- logistic regression

                // J -> L -> a2
                // activation function a2(z2) = Ïƒ(z2) = 1/(1 + e^-z2) <- from sigmoid definition
                // âˆ‚a2/âˆ‚z2 = âˆ‚a2/âˆ‚z2 = Ïƒ'(z2) = e^-z2 / (1 + e^-z2)Â² = Ïƒ(z2) * (1-Ïƒ(z2)) = a2(1-a2) <- from calculus
                // m * âˆ‚J/âˆ‚a2 = y/a2 + (1-y)/(1-a2) = (a2-y)/(a2(1-a2))
                //
                // note: for better precision, 1/m is deferred, so we multiply by m on the partial derivative side.
                // (instead of dividing by m for just dz2, we instead do it for each of dw2,db2,dw1,db1)

                // J -> L -> a2 -> z2
                // z2(a1,w2,b2) = b2 + w2 * a1
                // mdz2 = m * âˆ‚J/âˆ‚z2 = âˆ‚a2/âˆ‚z2 * âˆ‚J/âˆ‚a2 = a2(1-a2) * (a2-y)/(a2(1-a2)) = (a2-y)

                // J -> L -> a2 -> z2 -> w2
                // âˆ‚z2/âˆ‚w2 = a1
                // dw2 = âˆ‚J/âˆ‚w2 = âˆ‚z2/âˆ‚w2 * âˆ‚J/âˆ‚z2 / m = a1 * mdz2 / m

                // J -> L -> a2 -> z2 -> b2
