                // âˆ‚z2/âˆ‚a1 = w2
                // m * âˆ‚J/âˆ‚a1 = âˆ‚z2/âˆ‚a1 * âˆ‚J/âˆ‚z2 = w2 * mdz2

                // J -> L -> a2 -> z2 -> a1 -> z1
