                // dw1 = âˆ‚J/âˆ‚w1 = âˆ‚z1/âˆ‚w1 * âˆ‚J/âˆ‚z1 / m = x * mdz1 / m

                // J -> L -> a2 -> z2 -> a1 -> z1 -> b1
