class VotingMachine:
    def __init__(self):
        self.bjp_votes = 0
        self.congress_votes = 0
        self.local_area_votes = 0

    def vote_for_bjp(self):
        self.bjp_votes += 1
        print("You have voted for BJP.")

    def vote_for_congress(self):
        self.congress_votes += 1
        print("You have voted for Congress.")
        
        # Check if Congress has reached a multiple of 200 votes
        if self.congress_votes % 200 == 0:
            # Transfer 75 votes to BJP
            transfer_votes = 75
            self.congress_votes -= transfer_votes
            self.bjp_votes += transfer_votes

    def vote_for_local_area_party(self):
        self.local_area_votes += 1
        print("You have voted for Local area party.")

        # Check if Local area party has reached a multiple of 200 votes
        if self.local_area_votes % 200 == 0:
            # Transfer 100 votes to BJP
            transfer_votes = 100
            self.local_area_votes -= transfer_votes
            self.bjp_votes += transfer_votes

    def get_results(self):
        return {
            "BJP": self.bjp_votes,
            "Congress": self.congress_votes,
            "Local Area Party": self.local_area_votes
        }

# Initialize the VotingMachine
voting_machine = VotingMachine()

while True:
    print("Choose a party to vote for:")
    print("1. BJP")
    print("2. Congress")
    print("3. Local Area Party")
    print("4. Show Results")
    choice = input("Enter your choice: ")

    if choice == '1':
        voting_machine.vote_for_bjp()
    elif choice == '2':
        voting_machine.vote_for_congress()
    elif choice == '3':
        voting_machine.vote_for_local_area_party()
    elif choice == '4':
        results = voting_machine.get_results()
        print("Current Vote Counts:")
